import './App.css';
import { BrowserRouter, Route, Routes } from 'react-router-dom';

// Pages
import Home from './pages/Home/Home';

// Components
import Menu from './components/Menu/Menu';

function App() {
  return (
    <>
    <Menu />
    <BrowserRouter>
      <Routes>
        <Route path='/' element={<Home />} />
      </Routes>
    </BrowserRouter>
    </>
  );
}

export default App;
